import React from 'react';

const Header = props => {
  return (
    <header className="App-header">
      <p>My name is George Payne. How's it going, guys?</p>
      <p>
        These are my course certifications in descending order of date
        completed.
      </p>
      <p>
        Visitor, ask yourself. Would this person have all these
        certifications???
      </p>
    </header>
  );
};

export default Header;
